import React from 'react';


export  class Eview extends React.Component<any> {
    render(){
        return(
            <>
            <div key={this.props.random1} className="col">
            <span key={this.props.random2} >id:  {this.props.id}</span>  
          <span key={this.props.random3} >username:  {this.props.username}</span>  
          <span key={this.props.random4} >password:  {this.props.pass}</span>  
          <span key={this.props.random5} >firstname: {this.props.firstname}</span>  
          <span key={this.props.random6} >lastname: {this.props.lastname}</span>  
          <span key={this.props.random7} >email: {this.props.email}</span>  
          <span key={this.props.random8} >role: {this.props.role}</span>  
          </div>
            </>
        )
    }
}
